CREATE TABLE "sales" (
"sales_id" INTEGER,
"order_id" INTEGER,
"product_id" INTEGER,
"price_per_unit" INTEGER,
"quantity" INTEGER,
"total_price" INTEGER,
FOREIGN KEY("product_id") REFERENCES "products"("product_id"),
FOREIGN KEY("order_id") REFERENCES "orders"("order_id"),
PRIMARY KEY("sales_id")
);

